import React, { useState, useEffect } from 'react'

function App() {

  const [data, setData] = useState([{}]);

  useEffect(() => {
    fetch("/members").then(res =>
      res.json()
    ).then(
      data => {
        setData(data.members);
      }
    ).catch(
      error => console.log(error)
    )
  }, [data])

  const array = data.map((item,i)=>
  {
    console.log("In array declare:" + item);
    <li key={i}>{item}</li>
  });

  return (
    <div >
      <span>My new app</span>
      <ul>{array}</ul>
    </div>
  );
}

export default App;
